from typing import List


class Solution:

    def lexicographicallySmallestArray(self, nums: List[int], limit: int) -> List[int]:
        n = len(nums)
        j = 0
        target = [0 for _ in range(n)]
        while j < n:
            if target[j]==1:
                j+=1
                continue
            target[j] = 1
            dic = {j:nums[j]}
            i=j+1
            while i<n:
                t = True
                for d in dic:
                    if i not in dic and abs(dic[d] - nums[i]) <= limit:
                        dic[i] = nums[i]
                        target[i] = 1
                        i=j+1
                        t = False
                        break
                if t:
                    i+=1
            keys = sorted(dic.keys())
            values = sorted(dic.values())
            print(keys,values)
            for idx,key in enumerate(keys):
                nums[key] = values[idx]
            j += 1
        return nums
